import * as o from "react";
import i from "../lib/IconBase.es.js";
import c from "../defs/MicrosoftPowerpointLogo.es.js";
const r = o.forwardRef((t, e) => /* @__PURE__ */ o.createElement(i, { ref: e, ...t, weights: c }));
r.displayName = "MicrosoftPowerpointLogoIcon";
const a = r;
export {
  a as MicrosoftPowerpointLogo,
  r as MicrosoftPowerpointLogoIcon
};
